function SignUpForm() {
  return (
    <div>
      <form>
        <label>Name:</label>
        <input type="text" />
        <label>Email:</label>
        <input type="text" />
        <label>Password:</label>
        <input type="password" />
        <label>PasswordConfirm:</label>
        <input type="password" />
      </form>
    </div>
  );
}

export default SignUpForm;
